import React from "react";
import { FormGroup, FormControlLabel, Checkbox, GreenCheckbox, CheckBoxOutlineBlankIcon, CheckBoxIcon } from "@material-ui/core";

const CheckBoxInfo = () => {
    return (
        <FormGroup row>
          <FormControlLabel
            control={<Checkbox name="checkedA" />}
            label="Secondary"
          />
          <FormControlLabel
            control={
              <Checkbox
                name="checkedB"
                color="primary"
              />
            }
            label="Primary"
          />
          <FormControlLabel control={<Checkbox name="checkedC" />} label="Uncontrolled" />
          <FormControlLabel disabled control={<Checkbox name="checkedD" />} label="Disabled" />
          <FormControlLabel disabled control={<Checkbox checked name="checkedE" />} label="Disabled" />
          <FormControlLabel
            control={
              <Checkbox
                name="checkedF"
                indeterminate
              />
            }
            label="Indeterminate"
          />
          <FormControlLabel
            control={<GreenCheckbox name="checkedG" />}
            label="Custom color"
          />
          <FormControlLabel
            control={<Checkbox name="checkedH" />}
            label="Custom icon"
          />
          <FormControlLabel
            control={
              <Checkbox
                icon={<CheckBoxOutlineBlankIcon fontSize="small" />}
                checkedIcon={<CheckBoxIcon fontSize="small" />}
                name="checkedI"
              />
            }
            label="Custom size"
          />
        </FormGroup>
      );
}

export default CheckBoxInfo;
